    "templates/html/training.html": "<div class=\"window style-1 gui-rows spacing-md training-window ui\" style=\"bottom: 48px;\">\n\n  <div ui-id=desc>\n    <p>Welcome to <b>training</b> mode</p>\n    <p>In this mode you can train against a bot or invite up to 4 friends to explain them a game. It is a free for all mode - there are no teams.</p>\n  </div>\n\n  <div class=\"gui-cols spacing-sm soci-icons\" ui-id=social>\n  \n    <a ui-id=inviteLink class=\"gui-button green stretch just-center size-md\">Invite a friend</a>\n  \n  </div>\n\n  <div class=\"gui-cols spacing-sm grow-equal\">\n    \n    <button ui-id=help class=\"gui-button primary just-center size-md\">Help</button>\n    <button ui-id=exit class=\"gui-button primary just-center size-md\">Back to menu</button>\n\n  </div>\n\n</div>",
    "templates/html/tribe.html": "<div class=\"window full-window style-1 gui-rows scroll tribe-window\">\n\n  <div ui-id=\"tabs\" class=\"gui-toggles gui-cols grow-equal\" style=\"position: relative; z-index: 2\">\n    <span ui-value=\"tribe_map\">Map</span>      \n    <span class=\"\" ui-value=\"public_tribes\">Find tribe</span>      \n    <span class=\"not_logged_in\" ui-value=\"tribe_create\">Create tribe</span>      \n    <span class=\"logged_in\" ui-value=\"tribe_bulletin\">Bulletin</span>      \n    <span class=\"logged_in owner_only\" ui-value=\"tribe_edit_bulletin\">[EDIT] Bulletin</span>      \n    <span class=\"logged_in\" ui-value=\"tribe_members\">Members</span>      \n    <span class=\"logged_in\" ui-value=\"tribe_admin\">Administration</span>      \n  </div>\n\n  <div ui-id=\"content\" class=\"grow gui-rows\"></div>\n\n</div>\n",
    "templates/html/tribe_admin.html": "<div class=\"gui-rows spacing-md just-center align-center grow\">\n\n<div style=\"max-width: 800px;\" class=\"gui-rows spacing-md\">\n\n  <div class=\"gui-rows spacing-md admin\">\n\n    <div class=\"gui-form-divide\">Is this a public tribe?</div>\n\n    <span>If the tribe is marked as public it will appear on a public list where anyone can join it.</span>\n\n    <span ui-id=\"isPublic\">Public tribe</span>\n\n    <div class=\"gui-form-divide\">Public tribe description</div>\n\n    <textarea class=\"code-editor\" ui-id=\"description\" maxlength=\"512\"></textarea>\n\n    <div class=\"gui-form-divide\">One time link</div>\n\n    <span>This is a private link. It can only be used once. After someone joins the guild through this link - it is no longer valid. It also expires after a week.</span>\n\n    <div class=\"gui-cols spacing-md grow-equal\">\n\n      <input ui-id=\"privateLink\" type=text placeholder=\"invitation link\" class=\"gui-input size-md grow-2\" />\n      \n      <span ui-id=\"renewPrivateLink\" class=\"gui-button\">NEW PRIVATE LINK</span>    \n\n    </div>\n\n    <div class=\"gui-form-divide\">Public link</div>\n    \n    <span>This is a public link. Anyone can join your guild through this link. It's valid as long as you don't generate a new public link.</span>\n\n    <div class=\"gui-cols spacing-md grow-equal\">\n\n      <input ui-id=\"publicLink\" type=text placeholder=\"invitation link\" class=\"gui-input size-md grow-2\" />\n      <span ui-id=\"renewPublicLink\" class=\"gui-button\">NEW PUBLIC LINK</span>    \n\n    </div>\n\n  </div>\n\n  <div class=\"gui-form-divide\">Leave the tribe</div>\n\n  <span class=\"gui-button\" ui-id=\"leaveTribe\">Leave tribe</span>    \n\n</div>\n\n</div>",
    "templates/html/tribe_bulletin.html": "<div class=\"gui-rows tribe-bulletin grow\">\n\n  \n\n</div>\n",
    "templates/html/tribe_create.html": "  <div class=\"gui-rows spacing-md just-center grow\">\n\n    <div style=\"max-width: 600px\" class=\"gui-rows spacing-md\">\n\n    <div class=\"gui-cols grow-equal spacing-md size-md space-between\">\n\n        <input maxlength=6 ui-id=\"createTribeTag\" type=text placeholder=\"TRIBE TAG\" class=\"gui-input size-md\" />\n        <input maxlength=24 ui-id=\"createTribeName\" type=text placeholder=\"TRIBE NAME\" class=\"gui-input size-md\" />\n        <span ui-id=\"createTribe\" class=\"gui-button primary\">Create <span class=\"coins\">1000</span></span>\n\n    </div>\n\n    <div>If you have kicked yourself from a tribe type /recover_tribe in chat.</div>\n\n    </div>\n    \n  </div>\n",
    "templates/html/tribe_edit_bulletin.html": "<div class=\"gui-rows tribe-bulletin grow\">\n\n  <textarea class=\"code-editor\" ui-id=\"textarea\" wrap=\"off\"></textarea>\n\n  You can use HTML and CSS in this editor. Scripts are disabled.\n\n</div>",
