    "templates/temp/lobby_play_backup.html": "<div class=\"temp-lobby-play window style-1\">\n\n\n\n\n\n\n\n\n  <hr />\n\n  <div class=\"gui-rows\">\n    <div>lobby header</div>\n    <div>server select</div>\n    <div>login form</div>\n    <div>game settings</div>\n  </div>\n\n  <hr />\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  <div class=\"lobby-header\">\n\n    <div ui-id=armory style=\"text-align:center; display: inline-block;\">\n      <div ui-id=heroSprite class=\"style-2\" style=\"height: 120px; width: 120px\" title=\"Enter the armory to change your hat and weapon\"></div>\n      <span class=\"gold-label\">\n        <span ui-id=gold class=\"gold-number\">200</span>\n        <img src=\"images/patreon_icon_old.png\" width=16>\n      </span>\n    </div>\n\n    <div class=\"soci-icons\">\n      <a href=\"#\" ui-id=\"facebook\" class=\"soci-icon facebook\" title=\"Like the game on facebook\">\n        <span class=\"soci-label\">FACEBOOK</span>\n      </a>\n      <a href=\"#\" ui-id=\"twitter\" class=\"soci-icon twitter\" title=\"Follow the author on twitter\">\n        <span class=\"soci-label\">TWITTER</span>\n      </a>\n      <a href=\"#\" ui-id=\"discord\" class=\"soci-icon discord\" title=\"Chat about the game\">\n        <span class=\"soci-label\">DISCORD</span>\n        <span ui-id=discordCounter class=\"soci-numbers\">120</span>\n      </a>\n    </div>\n\n  </div>\n\n\n  <div class=\"server-selection\">\n\n    <span class=\"form-label\">Server</span>\n    <div ui-id=locations class=\"toggles\">\n      <button>EU</button>\n    </div>\n\n    <div class=\"gametype\">\n      <button ui-id=\"playQuick\" class=\"button primary\">QUICK GAME</button>\n      <button ui-id=\"playFootball\" class=\"button primary\">FOOTBALL</button>\n    </div>\n\n  </div>\n\n  <span class=\"form-label\">Login</span>\n  <div ui-id=loginPanel>\n    <a ui-id=\"facebookLogin\" target=\"_blank\" class=\"button facebook\" title=\"Login using Facebook\">\n      FACEBOOK\n    </a>\n    <a ui-id=\"patreonLogin\" target=\"_blank\" class=\"button patreon\">\n      PATREON\n    </a>\n  </div>\n\n  <div ui-id=logoutPanel>\n    <a ui-id=\"autoLogin\" class=\"checkbox checked\">AUTO LOGIN</a>\n    <button ui-id=\"logout\" class=\"button primary\">LOGOUT</button>\n  </div>\n\n  <p>\n    <input ui-id=name type=text placeholder=\"Name\" />\n    <button ui-id=claimName class=\"button primary\">CLAIM NAME</button>\n  </p>\n\n  <p><input ui-id=tribe type=text placeholder=\"Tribe\" /></p>\n\n    <button ui-id=settings class=\"button primary\">SETTINGS</button>\n\n</div>\n",
